import './App.css';
import Home from './pages/Homepage/Home';
import { BrowserRouter as Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div>
        <Routes>
          <Route exact path='/' element={<Home/>}/>
        </Routes>
    </div>
  );
}

export default App;
